    reflects changes in two contributions, the inkind contribution of Doyle Bartlett
    and a second contribution by Robert Loup.  The changes from primary 2008 to General
    2008 designation corrected a clerical inputting error on the original report.
    \ The contributions from the Farm Credit Council PAC, 9/5/2008, General Dynamics
    Voluntary PAC, 8/21/2008, and the Transportation Trades PAC, 9/26/2008 designated
    for the Primary Election 2008 cycle were all received after the August 12, 2008
    Colorado Primary Election and were accepted in error by the Perlmutter for Congress
    campaign.  To remedy this error refund checks have been sent to the three Political
    Action Committees.  These refunds will appear in the April 15, 2009 Quarterly
    Report.  Copies of the checks and letters have been sent to the FEC as requested."
